 mRNA assayed by Real time-PCR . Cytofluorimetric analysis showed that sildenafil significantly increased NO production in basal condition . This effect was partially inhibited by the PI3K inhibitor LY 294002 and completely inhibited by the NOS inhibitor L-NAME . Akt - 1 and

 activation was reduced in conditions mimicking insulin resistance and completely restored by sildenafil treatment . Conversely sildenafil treatment can counteract this noxious effect by increasing NO production through

 activation and reducing oxidative stress induced by hyperglycaemia and glucosamine . CONCLUSIONS / SIGNIFICANCE : These data indicate that sildenafil might improve NOS activity of endothelial cells in insulin resistance conditions and suggest the potential therapeutic use of sildenafil for improving vascular function in diabetic patients .</div>

 transdermal system : in the treatment of major depressive disorder . The monamine oxidase ( MAO ) inhibitor selegiline is selective for

 at the low oral dosages used in the treatment of Parkinson ' s disease . However , 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 is also inhibited at the high oral dosages needed to effectively treat depression ( not an approved indication ) , necessitating a tyramine-restricted diet . The selegiline transdermal system was designed to deliver antidepressant drug concentrations to the CNS , without substantially impairing small intestine

 activity . At the target dose of 6 mg / 24 hours , tyramine dietary restrictions are not needed . Short-term treatment with fixed ( 6 mg / 24 hours ) or flexible ( 6 , 9 or 12 mg / 24 hours ) doses of selegiline transdermal system was superior to placebo on most measures of antidepressant activity in 6 - or 8 - week , randomised , double-blind , multicentre studies in adult outpatients with major depressive disorder ( MDD ) . Likewise , long-term treatment with a fixed dose of selegiline transdermal system 6 mg / 24 hours was superior to placebo as maintenance therapy in a 52 - week , randomised , double-blind , multicentre , relapse-prevention trial in patients with MDD .

 transdermal system therapy was generally well tolerated in placebo-controlled studies ; application site reactions , mostly of mild to moderate severity , were the most commonly reported adverse events . The incidence of sexual adverse effects and weight gain was low and similar to that with placebo .</div>

<h2 style="margin: 0">7</h2>

<div class="entities" style="line-height: 2.5; direction: ltr">Potentiator ivacaftor abrogates pharmacological correction of F508

 in cystic fibrosis . Cystic fibrosis ( CF ) is caused by mutations in the CF transmembrane conductance regulator (

 ) . Newly developed &quot; correctors &quot; such as

<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 function in cells with the G551D mutation , consistent with clinical studies . In contrast , chronic VX - 770 administration caused a dose-dependent reversal of VX - 809 - mediated

 correction in F508 homozygous cultures . This result reflected the destabilization of corrected F508

 by VX - 770 , markedly increasing its turnover rate . Chronic VX - 770 treatment also reduced mature wild-type 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 levels and function . These findings demonstrate that chronic treatment with 
<mark class="entity" style="background: linear-gradient(90deg, #333366, #ffffff); padding: 0.45em 0.6em; margin: 0 0.25em; line-height: 1; border-radius: 0.35em;">

 potentiators and correctors may have unexpected effects that can not be predicted from short-term studies . Combining these drugs to maximize rescue of F508

 may require changes in dosing and / or development of new potentiator compounds that do not interfere with

 stability .</div>

 . However ,
